INSERT INTO sources (`id`, `name`, `description`, `datasetId`, `created_at`, `updated_at`) VALUES (406, 'Reynolds (2008)', '{\"dataPublishedBy\": \"Alan Reynolds. \\\"Marginal Tax Rates.\\\" The Concise Encyclopedia of Economics. 2008. Library of Economics and Liberty. Retrieved September 22, 2016 from the World Wide Web: http://www.econlib.org/library/Enc/MarginalTaxRates.html\", \"dataPublisherSource\": \"PricewaterhouseCoopers; International Bureau of Fiscal Documentation.\", \"link\": \"http://www.econlib.org/library/Enc/MarginalTaxRates.html\", \"retrievedDate\": \"22/09/2016\", \"additionalInfo\": \"Hong Kong’s maximum tax (the “standard rate”) has normally been 15 percent, effectively capping the marginal rate at high income levels (in exchange for no personal exemptions). The highest U.S. tax rate of 39.6 percent after 1993 was reduced to 38.6 percent in 2002 and to 35 percent in 2003.\"}', 303, '2018-03-08 18:37:{}', '2018-03-08 18:37:{}');
